import React from "react";
import BlogsHeader from "../BlogsHeader/BlogsHeader";
import RecentBlogs from "../RecentBlogs/RecentBlogs";

const Blogs = () => {
  return (
    <div>
      <BlogsHeader></BlogsHeader>
      <RecentBlogs></RecentBlogs>
      <RecentBlogs></RecentBlogs>

    </div>
  );
};

export default Blogs;
